        <br />Interested in more events from Kaytee like this one? "Like" our <a rel="noopener noreferrer" rel="noopener noreferrer" href="https://www.facebook.com/Kaytee.Brand/" target="_blank">Facebook page</a> for more information abut future events.&nbsp;<br /><embed src="https://www.youtube.com/embed/INfVUhE9GWo"><br /><p><img alt="Kaytee Pet Bird Blog " src="-/media/93414793810F45A098CD6E3EB3BCDC02.ashx?h=334&amp;w=500" style="width: 500px; height: 334px;" /></p> <p>&nbsp;</p> <p>Kaytee welcomes Michelle Goodman and bird expert Susan Clubb, DVM to share their expertise in our Webinar, &ldquo;Nutrition From The Wild&rdquo;. The team demonstrates how pet bird behaviors and nutritional needs are derived from their wild bird ancestors. Dr. Clubb discusses the behaviors and diets of birds in the wild as well as pet bird nutrition and how to encourage foraging to keep your feathered friends healthy and happy.</p>
